import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import Randoms from './random_password';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <Randoms />
  </React.StrictMode>
);

